"use strict";
module.exports = JSON.parse('{"qas":[{"question":"What is HackGT?","answer":"HackGT is HexLabs\' free, 36-hour, annual hackathon where students from across the world come together for a weekend in the fall to create innovative projects that show off their creativity and passion for development. You have the freedom to choose any platform, programming language, or format to show how you build solutions.\\nParticipating in this event will widen your professional network, build your portfolio, and allow you to put your creativity into production! With tech talks and workshops, you will also have the opportunity to talk to and learn from professionals in various industries. We encourage everyone to be a part of our hacker community at HackGT X regardless of location, major, or prior hacking experience."},{"question":"It\'s my first hackathon. Should I apply?","answer":"Yes! Experience is not required. Hackathons are open creative and learning environments for everyone. If you are new to hackathons, the Emerging Hacker track may be for you!"},{"question":"When does registration open?","answer":"Registration opens July 31st! Keep an eye out on our socials and subscribe to our newsletter for more information, coming soon 👀"},{"question":"Can I apply?","answer":"Any student over the age of 18 enrolled in any college or university is allowed to participate. If you are younger than 18, but a Georgia Tech student, you can still participate. Hacking experience is not required. Hackathons are open creative and learning environments for everyone- stay curious and try your best!"},{"question":"Did you say “FREE”?","answer":"YES! Once you\'re on GT\'s campus, HackGT X is completely free to participants and mentors thanks to our sponsors. Free food, free swag, free vibes. 😇 If you will be traveling from afar, we offer reimbursements to GT, but transportation will be your only cost otherwise."},{"question":"specialQs","answer":"cause json is so restricting and our use case is too expansive"},{"question":"What do I need for the event?","answer":"We recommend bringing a laptop, charger, headphones, and anything else you\'ll need over the weekend. We\'ll provide hardware, meals, snacks, swag, and ~good vibes~."},{"question":"What projects can I make? ","answer":"You can make anything you want! If you want more direction, we will have sponsor challenges and HackGT X tracks for both Advanced and Emerging participants. However, you may not submit your past projects to HackGT. We will send out an event packet containing project submission rules closer to October."},{"question":"I\'m not a solo hacker. How can I make a team?","answer":"No worries; we love multi-person hacker groups! We will host a team formation event after opening ceremony. You can also form a team with anyone! Teams can have up to four members. You are welcome to apply to either Emerging or Advanced track levels for each prize. Look out for more information about our team matching portal coming soon!"},{"question":"What are the prizes? Is there swag?","answer":"If you win a prize, we will make sure you get it no matter where in the world you are! We\'ll announce more info on prizes soon. HackGT X swag will be distributed during the event and there will be more opportunities to win exclusive items from winning activities or using points from event participation to redeem additional aesthetic swag. More information coming soon!"},{"question":"Who is eligible to mentor/volunteer?","answer":"Anyone can mentor or volunteer. If you are interested in helping participants through their projects, then apply as a mentor. If you are interested in helping us run the event, then apply as a volunteer!"},{"question":"Are we assigned mentors?","answer":"Mentorship this year will be in an Office Hours style format. Participants can submit questions via a virtual queue and meet mentors 1:1"},{"question":"Want to sponsor?","answer":"Contact us at sponsorship@hexlabs.org for more information"},{"question":"I have more questions...","answer":"Contact us at hello@hexlabs.org"}]}');

